// src/pages/newmusic.tsx
import React from "react";
import { Layout, styles } from "../layout/layout";

const NewMusic: React.FC = () => {
  return (
    <Layout title="New Music">
      <p style={styles.paragraph}>
        This page will host embedded videos. Below is <em>A Single Pedal of a Rose</em>.
      </p>

      <div style={{ textAlign: "center", margin: "20px 0" }}>
        <video
          controls
          preload="metadata"
          playsInline
          style={{
            width: "100%",
            maxWidth: 800,
            borderRadius: 8,
            outline: "none",
            backgroundColor: "#000",
          }}
        >
          {/* Update the filename below if your mp4 has a different name */}
          <source src="/a-single-pedal-of-a-rose.mp4" type="video/mp4" />
          Your browser does not support the video tag.
        </video>
      </div>
    </Layout>
  );
};

export default NewMusic;
